script: |
  super -f text -I q6620.spq | sort > q6620.out

inputs:
  - name: q6620.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN - col2 * + + 24 + + - col1 + + 21 + - + col0 / - col2 AND - - col2;
  - name: tab2

outputs:
  - name: q6620.out
    data: |
      46	51	23
      64	77	40
      75	67	58
